import React from "react";
import { HashRouter as Router, Route, Switch } from "react-router-dom";
import Carinfo from "routes/Carinfo"

const AppRouter = ({ car_ip }) => {
  return (
    <Router>
      <Route exact path="/">
        <Carinfo car_ip={car_ip} />
      </Route>
    </Router>
  );
};

export default AppRouter;
